
CREATE TABLE `usuarios` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `usuario` varchar(20) NOT NULL,
  `password` varchar(255) NOT NULL,
  `nombre` varchar(50) NOT NULL,
  `mail` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;


CREATE TABLE `mascotas` (
  `id_mascota` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nombre` varchar(45) NOT NULL,
  `descripcion` text,
  `imagen` mediumtext,
  `score` bigint(20) NOT NULL DEFAULT '0',
  `owner` int(11) unsigned NOT NULL,
  PRIMARY KEY (`id_mascota`),
  KEY `mascotas_usuarios_FK` (`owner`),
  CONSTRAINT `mascotas_usuarios_FK` FOREIGN KEY (`owner`) REFERENCES `usuarios` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=83 DEFAULT CHARSET=utf8;

CREATE TABLE `coments` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `coment` varchar(140) NOT NULL,
  `id_mascota` int(10) unsigned NOT NULL,
  `id_usuario` int(11) DEFAULT NULL,
  `dateTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;


